	add("phonaesthesia", "{\"term\":\"phonaesthesia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Apparently coined by British linguist {{w|John Rupert Firth}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any correspondence between the sound of a word and its meaning; examples include onomatopoeia and the use of phonaesthemes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, Laurence Picken, \u0027Musica Asiatica\u0027, Volume 4, [http://books.google.com.au/books?id\u003dXy45AAAAIAAJ\u0026amp;pg\u003dPA214\u0026amp;dq\u003d%22phonaesthesia%22+--intitle:%22Phonaesthetics%22\u0026amp;hl\u003den\u0026amp;ei\u003dseDUTsTbJKiXiQe14M2TDw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d7\u0026amp;ved\u003d0CFAQ6AEwBjg\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22phonaesthesia%22%20--intitle%3A%22Phonaesthetics%22\u0026amp;f\u003dfalse page 214\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"For this latter term, \u0027\u0027phonaesthesia\u0027\u0027 is doubtless at work, since kring is also ‘the sound of a small bell’\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Katie Wales, \u0027Northern English in Writing\u0027, Raymond Hickey (editor), \u0027Varieties of English in Writing: The written word as linguistic evidence\u0027, [http://books.google.com.au/books?id\u003d-8iuon1WfsEC\u0026amp;pg\u003dPA74\u0026amp;dq\u003d%22phonaesthesia%22+--intitle:%22Phonaesthetics%22\u0026amp;hl\u003den\u0026amp;ei\u003dMOXUTuGePO2UiAeykJWcDw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CC8Q6AEwADg\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22phonaesthesia%22%20--intitle%3A%22Phonaesthetics%22\u0026amp;f\u003dfalse page 74\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In contrast, writers of bucolic dialogues, like George Meriton, for instance, and lively song-writers like Robert Anderson in Cumberland, seem drawn to expressive lexis, marked by sound patterns of reduplication, alliteration and \u0027\u0027phonaesthesia\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Prue Goodwin, \u0027The Literate Classroom\u0027, [http://books.google.com.au/books?id\u003d6TO3ok6-1M8C\u0026amp;pg\u003dPA41\u0026amp;dq\u003d%22phonaesthesia%22+--intitle:%22Phonaesthetics%22\u0026amp;hl\u003den\u0026amp;ei\u003dseDUTsTbJKiXiQe14M2TDw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d5\u0026amp;ved\u003d0CEQQ6AEwBDg\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22phonaesthesia%22%20--intitle%3A%22Phonaesthetics%22\u0026amp;f\u003dfalse page 41\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Phonaesthesia\u0027\u0027 refers to the vaguer phenomenon whereby families of words with shared phonemes sometimes evoke related meanings in a not-quite-echoic manner\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Jean Boase-Beier, \u0027A Critical Introduction to Translation Studies\u0027, [http://books.google.com.au/books?id\u003dK-vQ_DLp6kIC\u0026amp;pg\u003dPA11\u0026amp;dq\u003d%22phonaesthesia%22+--intitle:%22Phonaesthetics%22\u0026amp;hl\u003den\u0026amp;ei\u003dMOXUTuGePO2UiAeykJWcDw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d2\u0026amp;ved\u003d0CDQQ6AEwATg\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22phonaesthesia%22%20--intitle%3A%22Phonaesthetics%22\u0026amp;f\u003dfalse page 11\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Those in (1.15) illustrate a weaker type of iconicity, generally known as \u0027\u0027phonaesthesia\u0027\u0027: the consonant cluster ‘fl’ seems to suggest quick movement, but it is not a direct representation of movement, or speed\", \"priority\":13}]}, \"synonyms\":{}}");

