	add("phoneme", "{\"term\":\"phoneme\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027φώνημα\u0027 (sound) from \u0027φωνέω\u0027 (to sound) from \u0027φωνή\u0027 (sound)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An indivisible unit of sound in a given language. A phoneme is an abstraction of the physical speech sounds (phones) and may encompass several different phones\", \"priority\":1}]}, \"synonyms\":{}}");

