	add("phonetician", "{\"term\":\"phonetician\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who specializes in the study of speech sounds and their representation by written symbols\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A dialectologist; a person who studies regional differences in speech sounds\", \"priority\":2}]}, \"synonyms\":{}}");

	add("phonetics", "{\"term\":\"phonetics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|phonetic|ics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the physical sounds of human speech, concerned with the physical properties of speech sounds (phones), and the processes of their physiological production, auditory reception, and neurophysiological perception, and their representation by written symbols\", \"priority\":1}]}, \"synonyms\":{}}");

