	add("phonology", "{\"term\":\"phonology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|phono|logy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the way sounds function in languages, including phonemes, syllable structure, stress, accent, intonation, and which sounds are distinctive units within a language\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The way sounds function within a given language\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1856\u0027\u0027, \u0027Journal of the Indian Archipelago and Eastern Asia\u0027, Mission Press, page 16\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The Achean, the ancient Malayu and other mixed \u0027\u0027phonologies\u0027\u0027 possessing a considerable degree of harshness, were thus formed\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Jacek Fisiak, \u0027Trends in Linguistics: Studies in Middle English Linguistics\u0027 (ISBN 3110152428), Walter de Gruyter, page 545\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Crucially, the neat separateness of \u0027\u0027phonologies\u0027\u0027 which my account seems to imply is an abstraction and does not mean that the \u0027\u0027phonologies\u0027\u0027 represented different regional or social dialects\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Charles W. Kreidler, \u0027Phonology\u0027, page 219\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Thus, underlying ‘agtus’ was converted first into ‘āgtus’ by the vowel lengthening rule, and then into ‘āktus’ by the ancient persistent rule. This example has previously been interpreted as indicating that new rules can enter a \u0027\u0027phonology\u0027\u0027 elsewhere than at depth I\", \"priority\":8}]}, \"synonyms\":{}}");

