	add("photobomb", "{\"term\":\"photobomb\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|photo|bomb|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act of photobombing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, \u0026quot;[http://www.dailymail.co.uk/news/article-2120914/Best-photobomb-EVER-Returning-Navy-sailor-surprises-grandmother-jumping-photo-birthday.html Best photobomb EVER! Returning Navy sailor surprises grandmother by jumping in a photo on her birthday]\u0026quot;, \u0027Daily Mail\u0027, 27 March 2012\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His person who uploaded the video, who appears to be Ellis\u0027 father, wrote in his description that the \u0027\u0027photobomb\u0027\u0027 was not the only surprise welcome they staged that day\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Lucy Carne, \u0026quot;[http://www.dailytelegraph.com.au/sport/london-olympics/john-coates-son-photobombs-the-queen-at-london-olympics-opening-ceremony/story-fncvqll5-1226439910358 John Coates\u0027 son photobombs the Queen at London Olympics Opening Ceremony]\u0026quot;, \u0027The Telegraph\u0027 (Sydney), 1 August 2012\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Twitter was also filled with comments about the Queen \u0027\u0027photobomb\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A photo containing someone or something that is photobombing\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Burt Constable, \u0026quot;[http://classifieds.dailyherald.com/story/?id\u003d229087 Phelps fatigue, feuds and flaps mean Olympics can\u0027t end soon enough]\u0026quot;, \u0027Daily Herald\u0027, 21 August 2008\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Athletes are celebrated just for competing. Russian gymnast Anna Pavlova, who recorded an imperfect 0.00 for one of her vault attempts, could try to land a \u0027\u0027photobomb\u0027\u0027 of herself mugging in the background of all those photos that will be taken of Phelps lugging around his gold\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Andrea Denhoed, \u0026quot;[http://www.newyorker.com/online/blogs/culture/2012/10/a-few-words-about-the-stingray-photobomb.html A Few Words About The Stingray Photobomb]\u0026quot;, \u0027The New Yorker\u0027, 9 October 2012\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Today, the photo can be labelled a \u0027\u0027photobomb\u0027\u0027, which implies a narrative of surreptitious sabotage, connects the stingray to a whole tribe of obnoxious pranksters, and makes the ray look like his smile might contain a hint of frat-boyish dissolution\", \"priority\":10}]}, \"synonyms\":{}}");

