	add("photuria", "{\"term\":\"photuria\", \"etymology\":{\"influencers\":[], \"languages\":[\"ancient greek (to 1453)\"], \"text\":\"Formed as {{confix|phot|uria|lang\u003den}}; equivalent to the Ancient greek (to 1453) \u0027φῶς\u0027 (light) + \u0027οὖρον\u0027 (urine)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Luminous or phosphorescent urine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1855\u0027\u0027: John Watt and Charles Watt [eds.], \u0027The Chemist\u0027, volume 2, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dfxoFAAAAQAAJ\u0026amp;pg\u003dPA695\u0026amp;dq\u003d%22photuria%22\u0026amp;lr\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0\u0026amp;ei\u003dQJS2S9_5NpW6zQTwtqEs\u0026amp;cd\u003d6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22photuria%22\u0026amp;f\u003dfalse page 695]\u0026lt;/span\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Various animal matters possess an acid reaction; urine, sweat, some portions of dead bodies, whether of men or animals have been luminous, and the presence of this microscopic algæ is the long mistaken cause of \u0027\u0027\u0027photuria\", \"priority\":4}]}, \"synonyms\":{}}");

